import styled from 'styled-components';

export const Button = styled.Button`
  color: red;
`;

export const divdiv = styled.div`
  width: 100%;
  height: 20rem;
  background-color: red;
`;

export const div = () => {
  return (
    <divdiv>
      <Button></Button>
      <Button></Button>
      <Button></Button>
    </divdiv>
  );
};
